function updateVis() {

	module('lively.persistence.Debugging').load()

	var obj = this.target
	var serializer = ObjectGraphLinearizer.forNewLivelyCopy();
	serializer.showLog = false;
	var copyPlugin = new CopyOnlySubmorphsPlugin();
	copyPlugin.root = obj;
	serializer.addPlugin(copyPlugin);

        this.serializer = serializer;
	var serialized = serializer.serialize(obj)

        // Properties.values(serializer.registry)[1].registeredObject

	var nodes = {},
	    i =0,
            ignoreClasses =  this.get('IgnoreList').getList(),
            ignoredNodeIds = [],
            activeNodes = [],
            group = {},
            links  = [];

	serializer.objectsDo(function(obj, id) {
                group[obj.__LivelyClassName__] = (group[obj.__LivelyClassName__] || 0) + 1
                if (ignoreClasses.include(obj.__LivelyClassName__ || 'undefined')) return;
		var classString = obj.__LivelyClassName__ ? " " +
                     obj.__LivelyClassName__.replace(/.*\./,"") : ""
                nodes[id] = ({nodeName: ""+id+classString    , 
                    id: id, index: i++, group: obj.__LivelyClassName__, obj: obj })
	})

	Properties.values(nodes).forEach(function(ea) {
		 serializer.referencesOfId(ea.id).forEach(function(refID) {
                        if (!nodes[ea.id] || !nodes[refID]) return
			links.push({
                            source: nodes[ea.id].index, 
                            target: nodes[refID].index, 
                            value: 1})
		})
	})
	this.graph = {
                nodes: Properties.values(nodes).sortBy(function(ea) {return ea.index}), 
                links: links};
	this.get('ProtoVisGraph').setGraphAndRender(this.graph)

        this.get('GroupList').setList(Properties.own(group)
                .withoutAll(ignoreClasses)
                .sortBy(function(ea) { return group[ea] }).reverse()
                .collect(function(ea) {
                return {isListItem: true, string: group[ea] + ' ' + ea, value: {name: ea, count: group[ea]} }    
        }))
}

