function ignoreClass() {
    if (!this.get('GroupList').selection) return;
    var className = this.get('GroupList').selection.name
    alertOK('ignore class ' + className)
    this.get('IgnoreList').setList(
        this.get('IgnoreList').getList().concat([className]).uniq().sort())
    var newList = this.get('GroupList').getList().reject(function(ea) {
        return ea.value.name === className
    })
    this.get('GroupList').getList().length
    this.get('GroupList').setList(newList)
    this.get('GroupList').selectAt(0)
}

