function setSelection(a) {
    alertOK("set selection " + a.id)
    if (!a || !a.obj || !this.serializer) return;
    this.selection = a

    var path = this.serializer.findIdReferencePathFromToId(0, Number(a.id), true);
    path.push(a.id)
    this.get('PathText').setTextString("path: " + path)

    this.get('PropertiesList').setList(
        Properties.own(a.obj).collect(function(ea) {
            return {isListItem: true, string: ea +": "+ String(a.obj[ea]).truncate(25), value: ea}
        })
    );

}
